	# ---------------
	# STATE DATA
	# ---------------
	# Game/Player
	LAST_RENDER: .word 0 # The time the last frame was rendered. TODO Add to game data...
	
	GAME_DATA: .space 40
	# 0 (b): level
	# 1 (b): game_phase
	# 2 (b): health_changed
	# 4 (w): background_address
	# 8 (w): collision_address
	
	USER_DATA: .space 52 # = s7
	# 0 (w): x-position
	# 4 (w): y-position
	# 8 (w): W time
	# 12 (w): A time
	# 16 (w): SPACE time
	# 20 (w): x-position (float)
	# 24 (w): y-position (float)
	# 28 (b): A_state
	# 29 (b): D_state
	# 30 (b): SPACE_state
	# 31 (b): on ground
	# 32 (b): animation state
	# 33 (b): health
	# 34 (b): laser_unlocked
	# 35 (b): laser_state
	# 36 (w): laser_time
	# 40 (b): facing
	# 41 (b): animation_offset
		# 3: laser mode
	# 42 (b): last_damage
	# 43 (b): draw_health
	# 44 (w): damage_tick
	
	ENTITY_COUNT: .word 0
	ENTITIES: .space 1280
	# ENTITY: 64 bytes each...
	# 0 (b): x
	# 1 (b): y
	# 2 (b): animation_state
	# 3 (b): width
	# 4 (b): height
	# 5 (b): entity_type
		# 0: laser power up
		# 1: green alien
		# 2: purple alien
		# 3: blue shard
	# 6 (b): dead
	# 7 (b): health
	# 8 (w): sprite_location
	# 12 (w): damaged_tick
	# 16 (w): sprite_width_4
	# 20 (w): dead_tick
	# 24 (b): animation_speed
	# 25 (b): animation_frames
	# 26 (b): final_y
	# 27 (b): draw_to_background
	# 28 (w): x (float) - blue shard
	# 32 (w): y (float) - blue shard
	# 36 (w): dx (float) - blue shard
	# 40 (w): dy (float) - blue shard
	# 44 (b): draw_to_background_done
	# 45 (b): draw_to_background_on_final_y
	
	# Render
	RENDER_BUFFER: .space 32768
	# Stores pixel colours to be rendered or unrendered in the next frame.
	# Bit 0: whether this pixel is in the render list (1) or not (0)
	# Bit 1: whether pixel should be drawn (1) or reset (0)
	
	RENDER_LIST: .space 4000
	RENDER_LIST_LAST: .word -4
	# List of display addresses that should be rendered/unrendered (colours stored in render buffer).
	
	TEXT_ANIMATION_DATA: .space 40
	# 0: last_char_time (w)
	# 4: current_line (b)
	# 5: current_char (b)
	# 6: lines (b)
	# 7: finished (b)
	# 8: x-pos (b)
	# 9: y-pos (b)
	# 12: line 1 (w)
	# 16: line 2 (w)
	# 20: line 3 (w)
	# 24: finished tick (w)
	
	# ---------------
	# CONSTANTS
	# ---------------
	# Strings
	YEAR_IS: .asciiz "YEAR IS 2373:"
	ALIENS_HAVE: .asciiz "ALIENS HAVE TAKEN OVER"
	
	YOU_ARE: .asciiz "YOU ARE AI'S LAST HOPE"
	TAKE_THIS: .asciiz "TAKE THIS UPGRADE"
	
	PREPARE_TO: .asciiz "PREPARE TO DIE"
	
	I_WONDER: .asciiz "I WONDER WHERE THIS"
	SPACESHIP: .asciiz "SPACESHIP WILL TAKE ME"
	
	WITH_THIS: .asciiz "WITH THIS POWER I WILL"
	BE_ABLE: .asciiz "BE ABLE TO SAVE EARTH"
	
	E_LASER: .asciiz "E: LASER"
	
	# Addresses
	.eqv BITMAP_BASE 0x10008000
	.eqv KEYBOARD_STATUS 0xFFFF0000
	.eqv KEYBOARD_KEY 0xFFFF0004
	.eqv BUFFER_SIZE 32768

	# Sprite Constants
	.eqv LEVEL_WIDTH 128
	.eqv LEVEL_WIDTH_4 512
	.eqv LEVEL_HEIGHT 64
	
	.eqv PLAYER_HEIGHT 14
	.eqv PLAYER_WIDTH 11
	.eqv PLAYER_SPRITE_WIDTH_4 264 # 11 * 6 * 4
	
	.eqv FONT_SPRITE_SIZE 5
	.eqv FONT_SPRITE_WIDTH_4 1040 # 260 * 4
	.eqv FONT_SPRITE_START 39
	
	.eqv ITEM_SIZE 7
	.eqv LASER_SPRITE_WIDTH_4 140 # 7 * 5 * 4

	.eqv HEART_SIZE 7
	.eqv HEARTS_SPRITE_WIDTH_4 112 # 7 * 4 * 4
	
	.eqv GREEN_ALIEN_SPRITE_WIDTH_4 220 # 11 * 5 * 4
	
	.eqv PURPLE_ALIEN_WIDTH 9
	.eqv PURPLE_ALIEN_HEIGHT 11
	.eqv PURPLE_ALIEN_SPRITE_WIDTH_4 216 # 9 * 6 * 4
	
	.eqv BLUE_SHARD_SIZE 5
	.eqv BLUE_SHARD_SPRITE_WIDTH_4 20 # 5 * 4
	
	.eqv ENTITY_STRUCT_BYTES 64
	.eqv ENTITY_STRUCT_BIT_SHIFT 6
	
	.eqv FLYING_SAUCER_WIDTH 27
	.eqv FLYING_SAUCER_HEIGHT 12
	.eqv FLYING_SAUCER_SPRITE_WIDTH_4 108 # 27 * 4
	
	.eqv PORTAL_ITEM_SPRITE_WIDTH_4 112 # 7 * 4 * 4
	
	# Floats
	ZERO: .float 0.0
	TWO: .float 2.0
	THREE: .float 3.0
	FIVE: .float 5.0
	
	# ---------------
	# SETTINGS
	# ---------------
	.eqv KEY_TIME_CONST 20
	KEY_TIME: .word KEY_TIME_CONST # key press duration, in ticks
	.eqv ALIEN_ATTACK_SPEED 20 # attack speed, in ticks
	.eqv DAMAGE_TIME 40 # damage invincibility frames, in ticks
	left: .float -1.0
	right: .float 1.0
	upwards: .float -2.00
	gravity: .float 0.80

.text

# Saved Values
# s4 = render_list_last
# s5 = time
# s6 = tick
# s7 = user data
.globl main
main:
	jal reset_game_state

	# Set level 1
	li $a0 0 # level = 0
	jal set_level
	sb $zero GAME_DATA+1 # game_phase = 0
	jal reset_game_state

	draw_start:
	li $v0, 30
	syscall
	andi $a0 $a0 0x7FFFFFFF # time bug band-aid
	move $s5 $a0 # s5 = time
	lw $t0 LAST_RENDER
	sub $t3 $s5 $t0
	ble $t3 16 after_draw # if dt >= (1/60)ms:
		sw $s5 LAST_RENDER # last_render = time
		
		jal handle_movement
		jal tick_level
		jal tick_text_animation
		jal tick_entities
		jal tick_player
		addi $s6 $s6 1 # tick += 1

	after_draw:
	jal render_level_extras
	li $a0 0 # forced = false
	jal render_entities
	jal draw_player
	li $a0 0 # forced = false
	jal draw_gui
	jal render_buffer
	
	jal handle_inputs

	# wait 1ms
	li $v0, 32
	li $a0, 1
	syscall
	j draw_start

    	# exit program
	li $v0 10
	syscall
	
reset_game_state:
	# Set saved variables
	la $s7 USER_DATA # s7 = user data
	li $s4 -4 # s4 = render_list_last = -4
	li $t0 KEY_TIME_CONST
	sw $t0 KEY_TIME

	# Reset entities
	sw $zero ENTITY_COUNT

	# Reset movement
	sb $zero USER_DATA+28 # a_state = false
	sb $zero USER_DATA+29 # d_state = false
	sb $zero USER_DATA+30 # space_state = false
	li $t0 1

	# Reset health
	li $t0 3
	sb $t0 USER_DATA+33 # health = 3
	sb $t0 USER_DATA+42 # last_damage = 3
	
	# Reset laser
	li $t0 0
	sb $t0 USER_DATA+34 # laser_unlocked = false
	sb $zero USER_DATA+41 # animation_offset = 0

	jr $ra
	
render_level_extras:
	lb $t0 GAME_DATA+0 # t0 = level
	lb $t1 GAME_DATA+1 # t1 = level_phase
	# Level 2 Phase 5
	bne $t0 1 after_render_level_extras # if level == 1:
	bne $t1 2 extras_phase_4 # if level_phase == 2:
		# Store $ra in stack
		addi $sp $sp -4
		sw $ra 0($sp)
		la $a0 E_LASER # asciiz_address
		li $a1 83 # x
		li $a2 3 # y
		jal draw_text
		# Restore $ra from stack
		lw $ra 0($sp)
		addi $sp $sp 4
		jr $ra
	extras_phase_4:
	bne $t1 4 after_render_level_extras # if level_phase == 4:
		li $t3 ENTITY_STRUCT_BYTES
	
		# Skip render if draw to background
		lb $a2 ENTITIES+27($t3) # t0 = draw_to_background
		beqz $a2 after_skip_render_saucer # if draw_to_background
		lb $t0 ENTITIES+44($t3) # t0 = draw_to_background_done
		beqz $t0 after_skip_render_saucer # && draw_to_background_done
		j after_render_level_extras # continue
		
		after_skip_render_saucer:
		# Flying saucer
		lb $t0 ENTITIES+0($t3) # flying_saucer_x = green_alien_x - 13
		addi $t0 $t0 -13 
		lb $t1 ENTITIES+1($t3) # flying_saucer_y = green_alien_y + 7
		addi $t1 $t1 7
		
		li $a0 FLYING_SAUCER_WIDTH # entity_width
		#li $a2 0 # draw_background = false
		li $a1 FLYING_SAUCER_HEIGHT # entity_height
		la $t6 FLYING_SAUCER_SPRITE # sprite_location
		li $a3 FLYING_SAUCER_SPRITE_WIDTH_4 # entity_sprite_width_4
		li $t8 0 # sprite_index
		move $s0 $ra
		jal draw_sprite
		move $ra $s0
	
	after_render_level_extras:
	jr $ra
	
tick_player:
	lb $t0 GAME_DATA+2 # t0 = health_changed
	beqz $t0 tick_laser # if health_changed == true:
		lw $t1 USER_DATA+44 # t1 = damaged_tick
		sub $t2 $s6 $t1 # t2 = tick - damaged_tick
		blt $t2 DAMAGE_TIME tick_laser # if tick - damaged_tick >= DAMAGE_TIME
			sb $zero GAME_DATA+2 # health_changed = 0
			li $t1 1
			sb $t1 USER_DATA+43 # draw_health = true
	# Tick laser
	tick_laser:
	lb $t0 USER_DATA+35 # laser_state
	beqz $t0 after_draw_laser
		lw $t0 USER_DATA+36 # laser_time
		sub $t0 $s6 $t0
		lw $t1 KEY_TIME
		sub $t0 $t0 $t1
		bgez $t0 reset_laser # if time - laser_time < 100ms:
			lw $s0 USER_DATA+0 # s0 = player_x
			addi $s0 $s0 3
			lw $s1 USER_DATA+4 # s1 = player_y
			addi $s1 $s1 -1
			lb $s2 USER_DATA+40 # s2 = facing
			
			lw $t0 ENTITY_COUNT
			sll $t0 $t0 ENTITY_STRUCT_BIT_SHIFT # s0 = entity_count * 64
			li $t1 0
			laser_entities_loop:
			bge $t1 $t0 after_laser_entities_loop # if i < entity_count:
				lb $t2 ENTITIES+6($t1) # t2 = dead
				bnez $t2 after_entity_laser # if dead: continue
				
				lb $t2 ENTITIES+5($t1) # t2 = entity_type
				bne $t2 1 after_entity_laser # if entity_type != green_alien: continue
				
				lb $t2 ENTITIES+0($t1) # t2 = x
				lb $t3 ENTITIES+1($t1) # t2 = y
				
				# Check on laser side of screen
				bnez $s2 facing_right
				bgt $t2 $s0 after_entity_laser # if facing == left && x <= player_x:
					j after_check_facing
				facing_right:
				blt $t2 $s0 after_entity_laser # or facing == right && x >= player_x:
				
				# Check within laser width
				after_check_facing:
				addi $t4 $s1 7 # t4 = laser_bottom, s1 = laser_top
				blt $t3 $s1 after_entity_laser # if y >= laser_top
				bgt $t3 $t4 after_entity_laser # if y <= laser_bottom
				
				lw $t2 ENTITIES+12($t1) # t2 = damaged_tick
				sub $t2 $s6 $t2 # t2 = tick - damaged_tick
				blt $t2 DAMAGE_TIME after_entity_laser # if dtick >= DAMAGE_TIME:
					sw $s6 ENTITIES+12($t1) # damaged_tick = tick
					
					lb $t2 ENTITIES+7($t1) # t2 = health
					subi $t2 $t2 1
					sb $t2 ENTITIES+7($t1) # health -= 1
					
					# Midi text laser hit sound
					li $a0 60
					li $a1 250
					li $a2 123
					li $a3 40
					li $v0 31
					syscall
					
					bnez $t2 after_entity_laser # if health == 0:
						li $t2 1
						sb $t2 ENTITIES+6($t1) # dead = true
						lb $t2 ENTITIES+27($t1) # t2 = draw_to_background
						beqz $t2 after_redraw_dead
							# Store $ra in stack
							addi $sp $sp -4
							sw $ra 0($sp)
							move $a0 $t1 # a0 = entity_address
							jal clear_entity_background
							# Restore $ra from stack
							lw $ra 0($sp)
							addi $sp $sp 4
						after_redraw_dead:
					 
				after_entity_laser:
				addi $t1 $t1 ENTITY_STRUCT_BYTES # i += 64
				j laser_entities_loop
			after_laser_entities_loop:
			jr $ra
		reset_laser:
		sb $zero USER_DATA+35 # laser_state = false
	after_tick_laser:
	jr $ra
	
# a0 = forced_draw
render_entities:
	lw $s0 ENTITY_COUNT
	sll $s0 $s0 ENTITY_STRUCT_BIT_SHIFT # s0 = entity_count * 64
	li $s1 0
	move $s2 $ra
	
	render_entities_loop:
	bge $s1 $s0 after_render_entities # if i < entity_count:
		lb $t0 ENTITIES+6($s1) # t0 = dead
		bnez $t0 after_render_entity # if dead: continue
		
		lb $a2 ENTITIES+27($s1) # t0 = draw_to_background
		bnez $a0 after_skip_draw # forced_draw
		
		# Skip render if draw to background
		#lb $a2 ENTITIES+27($s1) # t0 = draw_to_background
		beqz $a2 after_skip_draw # if draw_to_background
		lb $t0 ENTITIES+44($s1) # t0 = draw_to_background_done
		beqz $t0 after_skip_draw # && draw_to_background_done
		j after_render_entity # continue

		after_skip_draw:
		li $t0 1
		sb $t9 ENTITIES+44($s1) # draw_to_background_done = true
		
		lb $t0 ENTITIES+0($s1) # t2 = x
		lb $t1 ENTITIES+1($s1) # t1 = y
		lb $a0 ENTITIES+3($s1) # a0 = width
		lb $a1 ENTITIES+4($s1) # a1 = height
		
		# Center entity around x/y position...
		srl $t2 $a0 1 # t2 = width // 2
		sub $t0 $t0 $t2 # x -= width // 2
		srl $t2 $a1 1 # t2 = height // 2
		sub $t1 $t1 $t2 # y -= height // 2		
		
		#move $a2 $zero # don't draw to background
		lw $t6 ENTITIES+8($s1) # t6 = sprite_location
		lw $a3 ENTITIES+16($s1) # a3 = entity_sprite_width_4
		lb $t8 ENTITIES+2($s1) # t8 = animation_state
		jal draw_sprite
		
		after_render_entity:
		addi $s1 $s1 ENTITY_STRUCT_BYTES # i += 64
		j render_entities_loop
	after_render_entities:
	jr $s2

tick_entities:
	lw $t0 ENTITY_COUNT
	sll $t0 $t0 ENTITY_STRUCT_BIT_SHIFT # t0 = entity_count_bytes = entity_count * 64
	li $t1 0
	tick_entities_loop:
	bge $t1 $t0 after_tick_entities # if i < entity_count:
		lb $t2 ENTITIES+6($t1) # t0 = dead
		bnez $t2 next_entity # if dead: continue
	
		# Tick animation
		lb $t2 ENTITIES+24($t1) # t2 = animation_speed
		beq $t2 -1 after_tick_animation # if animation_speed != -1
		rem $t2 $s6 $t2
		bnez $t2 after_tick_animation # && tick % animation_speed == 0:
			lb $t4 ENTITIES+25($t1) # t4 = animation_frames
			lb $t2 ENTITIES+2($t1) # t2 = animation_state
			addi $t2 $t2 1
			rem $t2 $t2 $t4 # t2 = (animation_state + 1) % animation_frames
			sb $t2 ENTITIES+2($t1) # animation_state = (animation_state + 1) % animation_frames
			sb $zero ENTITIES+44($t1) # draw_to_background_done = false
		after_tick_animation:
		
		# Tick gravity
		lb $t2 ENTITIES+26($t1) # t2 = final_y
		beq $t2 -1 after_tick_gravity # if final_y != -1
			andi $t3 $s6 0x1
			bnez $t3 after_tick_gravity # if tick % 2 == 0:
				lb $t3 ENTITIES+1($t1) # t3 = y
				bge $t3 $t2 after_tick_gravity # if y < final_y:
					addi $t3 $t3 1
					sb $t3 ENTITIES+1($t1) # y += 1
					lb $t4 ENTITIES+45($t1) # draw_to_background_on_final_y
					beqz $t4 after_tick_gravity # if draw_to_background_on_final_y:
						bne $t3 $t2 after_tick_gravity # if y == final_y:
							li $t2 1
							sb $t2 ENTITIES+27($t1) # draw_to_background = true
							sb $zero ENTITIES+44($t1) # draw_to_background_done = false
					j after_tick_gravity
					
				
		after_tick_gravity:
	
		lb $t2 ENTITIES+5($t1) # t2 = entity type
		# Green alien
		tick_green_alien:
		bne $t2 1 tick_blue_shard # if entity_type = 1 = green_alien
			lb $t2 ENTITIES+2($t1) # t2 = animation_state
			bne $t2 4 after_spawn_shard # if animation_state == 4 (last):
			lb $t2 ENTITIES+1($t1) # t2 = y
			blez $t2 after_spawn_shard # && y > 0
				# Reset animation
				sb $zero ENTITIES+2($t1)
				
				# Spawn blue shard
				lb $t2 ENTITIES+0($t1)
				sb $t2 ENTITIES+0($t0) # x = entity_x
				mtc1 $t2 $f0
				cvt.s.w $f0 $f0
				mfc1 $t2 $f0
				sw $t2 ENTITIES+28($t0) # float_x = (float) x
				
				lb $t2 ENTITIES+1($t1)
				sb $t2 ENTITIES+1($t0) # y = entity_y
				mtc1 $t2 $f1
				cvt.s.w $f1 $f1
				mfc1 $t2 $f1
				sw $t2 ENTITIES+32($t0) # float_y = (float) y
				
				# Calculate dx/dy between player and shard
				lw $t2 USER_DATA+20 # t2 = player_x (float)
				mtc1 $t2 $f2
				l.s $f12 THREE
				add.s $f2 $f2 $f12 # move to center x of player
				
				lw $t2 USER_DATA+24 # t2 = player_y (float)
				mtc1 $t2 $f3
				l.s $f12 FIVE
				add.s $f3 $f3 $f12 # move to center y of player
				
				sub.s $f0 $f2 $f0 # dx = player_x - shard_x
				sub.s $f1 $f3 $f1 # dy = player_y - shard_y
				
				mul.s $f2 $f0 $f0 # f2 = dx^2
				mul.s $f3 $f1 $f1 # f3 = dy^2
				add.s $f2 $f2 $f3 # f2 = dx^2 + dy^2
				sqrt.s $f2 $f2 # f2 = sqrt(dx^2 + dy^2)
				div.s $f0 $f0 $f2 # f0 = f0 / sqrt(dx^2 + dy^2)
				div.s $f1 $f1 $f2 # f1 = f1 / sqrt(dx^2 + dy^2)

				mfc1 $t2 $f0
				sw $t2 ENTITIES+36($t0) # dx = f0
				mfc1 $t2 $f1
				sw $t2 ENTITIES+40($t0) # dy = f1
				
				sb $zero ENTITIES+2 # animation_state = 0
				li $t2 BLUE_SHARD_SIZE
				sb $t2 ENTITIES+3($t0) # width
				sb $t2 ENTITIES+4($t0) # height
				li $t2 3
				sb $t2 ENTITIES+5($t0) # entity_type = 3 = blue shard
				sb $zero ENTITIES+6($t0) # dead = false
				la $t2 BLUE_SHARD_SPRITE
				sw $t2 ENTITIES+8($t0) # sprite_location
				li $t2 BLUE_SHARD_SPRITE_WIDTH_4
				sw $t2 ENTITIES+16($t0) # sprite_width_4
				li $t2 -1
				sb $t2 ENTITIES+24($t0) # animation_speed = -1
				
				addi $t0 $t0 ENTITY_STRUCT_BYTES # entity_count_bytes += 64
				lw $t2 ENTITY_COUNT
				addi $t2 $t2 1
				sw $t2 ENTITY_COUNT # entity_count += 1
			after_spawn_shard:
			j next_entity

		# Blue shard
		tick_blue_shard:
		bne $t2 3 next_entity # if entity_type = 3 = blue shard
			# Check player collision & damage
			lw $t2 USER_DATA+0 # player_x
			lw $t3 USER_DATA+4 # player_y
			addi $t2 $t2 3
			addi $t3 $t3 5
			lb $t4 ENTITIES+0($t1) # x
			lb $t5 ENTITIES+1($t1) # y
			sub $t2 $t2 $t4
			sub $t3 $t3 $t5
			mul $t2 $t2 $t2 
			mul $t3 $t3 $t3
			add $t2 $t2 $t3
			bge $t2 9 after_damage_player_shard # if distance > 3^2
				move $s0 $ra
				move $s1 $t0
				move $s2 $t1
				move $a0 $t1 # delete_address = t1
				jal delete_entity
				jal damage_player
				move $ra $s0
				move $t0 $s1
				move $t1 $s2
			after_damage_player_shard:
		
			# Tick movement
			lw $t2 ENTITIES+28($t1)
			mtc1 $t2 $f0 # f0 = float_x
			lw $t2 ENTITIES+32($t1)
			mtc1 $t2 $f1 # f1 = float_y
		
			lw $t2 ENTITIES+36($t1)
			mtc1 $t2 $f2 # f2 = dx
			lw $t2 ENTITIES+40($t1)
			mtc1 $t2 $f3 # f3 = dy
			
			add.s $f0 $f0 $f2 # f0 = float_x + dx
			mfc1 $t2 $f0
			sw $t2 ENTITIES+28($t1) # float_x += dx
			#cvt.w.s $f0 $f0 # f0 = (int) float_x
			round.w.s $f0 $f0 # f0 = round(float_x)
			mfc1 $t3 $f0 # t3 = (int) float_x
			sb $t3 ENTITIES+0($t1) # x = (int) float_x
			
			add.s $f1 $f1 $f3 # f1 = float_y + dy
			mfc1 $t2 $f1
			sw $t2 ENTITIES+32($t1) # float_y += dy
			# cvt.w.s $f1 $f1 # f1 = (int) float_y
			round.w.s $f1 $f1 # f1 = rouund(float_y)
			mfc1 $t4 $f1 # t4 = (int) float_y
			sb $t4 ENTITIES+1($t1) # y = (int) float_y
			
			bltz $t3 delete_shard # if x < 0
			bge $t3 LEVEL_WIDTH delete_shard # or x >= LEVEL_WIDTH
			bltz $t4 delete_shard # or y < 0
			bge $t4 LEVEL_HEIGHT delete_shard # or y >= LEVEL_HEIGHT
			j next_entity
				delete_shard:
				subi $t0 $t0 ENTITY_STRUCT_BYTES # entity_count_bytes -= 64

				move $s0 $ra
				move $s1 $t0
				move $s2 $t1
				move $a0 $t1 # delete_address = t1
				jal delete_entity
				move $ra $s0
				move $t0 $s1
				move $t1 $s2
				j tick_entities_loop
		next_entity:
		addi $t1 $t1 ENTITY_STRUCT_BYTES # i += 64
		j tick_entities_loop

	after_tick_entities:
	jr $ra

# a0 = delete_address
delete_entity:
	# Decrement entity_count
	lw $t1 ENTITY_COUNT
	subi $t1 $t1 1 # t1 = entity_count - 1
	sw $t1 ENTITY_COUNT # entity_count -= 1
	sll $t0 $t1 ENTITY_STRUCT_BIT_SHIFT # t0 = last_entity_address = (entity_count - 1) * 64

	bne $a0 $t0 copy_entity_values # if a0 == t0: return
		jr $ra

	# Copy entity values
	copy_entity_values:
	li $t2 0
	copy_entity_values_loop:
	bge $t2 ENTITY_STRUCT_BYTES after_copy_entity_values
		lw $t3 ENTITIES($t0)
		sw $t3 ENTITIES($a0)
		addi $t0 $t0 4
		addi $a0 $a0 4
		addi $t2 $t2 4
		j copy_entity_values_loop
	after_copy_entity_values:
	jr $ra
	
damage_player:
	lw $t0 USER_DATA+44 # t0 = damage_tick
	sub $t1 $s6 $t0 # t1 = tick - damage_tick
	blt $t1 DAMAGE_TIME after_damage_player # if tick - damage_tick >= DAMAGE_TIME
		sw $s6 USER_DATA+44 # damage_tick = tick
	
		lb $t0 USER_DATA+33 # t0 = health
		sb $t0 USER_DATA+42 # last_health = health
		subi $t0 $t0 1
		sb $t0 USER_DATA+33 # health -= 1
		li $t1 1
		sb $t1 GAME_DATA+2 # health_changed = true
		sb $t1 USER_DATA+43 # draw_health = true

		bgtz $t0 after_damage_player # if health == 0
			j main
	after_damage_player:
	jr $ra

tick_level:
	lb $t0 GAME_DATA+0 # t0 = level
	bnez $t0 tick_level_2 # if level == 0:
		# Fire is at (55, 50)
		li $t0 55
		li $t1 50
		lw $t2 USER_DATA+0 # x
		lw $t3 USER_DATA+4 # y
		addi $t2 $t2 3
		addi $t3 $t3 5
		
		sub $t0 $t0 $t2 # 55 - x
		sub $t1 $t1 $t3 # 50 - y
		mul $t0 $t0 $t0 # (55 - x)^2
		mul $t1 $t1 $t1 # (50 - y)^2
		add $t0 $t0 $t1 # distance = (55 - x)^2 + (50 - y)^2
		bge $t0 150 after_check_fire # if distance < 10 (10^2 = 100)
			move $s0 $ra
			jal damage_player
			move $ra $s0
		after_check_fire:
		
		lw $t0 0($s7) # t0 = x_position
		blt $t0 128 after_switch_level_2 # if x_position >= 128:
			li $a0 1
			jal set_level # Set level 2
			j draw_start
		after_switch_level_2:
		jr $ra

	tick_level_2:
	bne $t0 1 tick_level_3 # if level == 1:
		lb $t0 GAME_DATA+1 # t0 = game_phase
		bnez $t0 level_2_phase_2 # if game_phase == 0:
			lb $t0 TEXT_ANIMATION_DATA+7 # t0 = finished
			beqz $t0 after_switch_level_2_phase_2 # if finished:
			lw $t1 TEXT_ANIMATION_DATA+24 # t1 = finished_tick
			sub $t2 $s6 $t1 # t2 = tick - finished_tick
			blt $t2 30 after_switch_level_2_phase_2 # && dtick >= 30
				# Switch to phase 2
				li $t0 1
				sb $t0 GAME_DATA+1 # game_phase = 1
				j level_2_phase_2
			after_switch_level_2_phase_2:
			jr $ra

		level_2_phase_2:
		bne $t0 1 level_2_phase_3 # if game_phase == 1:
			# Store $ra in stack
			addi $sp $sp -4
			sw $ra 0($sp)
			jal clear_level_text
			# Restore $ra from stack
			lw $ra 0($sp)
			addi $sp $sp 4
			
			# Spawn laser item
			li $t0 1
			sw $t0 ENTITY_COUNT
			
			li $t0 59
			sb $t0 ENTITIES+0 # x = 56
			sb $zero ENTITIES+1 # y = -7
			sb $zero ENTITIES+2 # animation_state = 0
			li $t0 ITEM_SIZE
			sb $t0 ENTITIES+3 # width
			sb $t0 ENTITIES+4 # height
			sb $zero ENTITIES+5 # entity_type = 0 = laser
			sb $zero ENTITIES+6 # not dead
			la $t0 ITEM_LASER_SPRITE
			sw $t0 ENTITIES+8 # sprite_location
			li $t0 LASER_SPRITE_WIDTH_4
			sw $t0 ENTITIES+16 # sprite_width_4
			li $t0 5
			sb $t0 ENTITIES+24 # animation_speed = 5
			sb $t0 ENTITIES+25 # animation_frames = 5
			li $t0 45
			sb $t0 ENTITIES+26 # final_y = 45
			sb $zero ENTITIES+27 # draw_to_background = false
			sb $zero ENTITIES+45 # draw_to_background_on_final_y = false
			
			# Switch to phase 3
			li $t0 2
			sb $t0 GAME_DATA+1 # game_phase = 2
			jr $ra

		level_2_phase_3:
		bne $t0 2 level_2_phase_4 # if game_phase == 2:
			lb $t0 ENTITIES+6 # t0 = dead
			bnez $t0 after_pick_up_laser # if !dead:
				# Check item collision with player
				lw $a0 USER_DATA+0 # a0 = player_x
				lw $a1 USER_DATA+4 # a1 = player_y
				lb $t5 ENTITIES+0 # t5 = entity_left
				subi $t5 $t5 3 # left -= item_size//2
				lb $t8 ENTITIES+1 # t8 = entity_top
				subi $t8 $t8 3 # top -= item_size//2
				addi $t7 $t5 ITEM_SIZE # t9 = entity_right
				addi $t6 $t8 ITEM_SIZE # t9 = entity_bottom
				move $s0 $ra
				jal check_collision
				move $ra $s0
			
				beqz $v0 no_laser_collision # if collision:
					sb $v0 ENTITIES+6 # dead = true
					sw $s6 ENTITIES+20 # dead_tick = tick
					sb $v0 USER_DATA+34 # laser_unlocked = true
					li $t0 3
					sb $t0 USER_DATA+41 # animation_offset = 3 (red)
					
					# Setup text animation
					la $t0 TEXT_ANIMATION_DATA
					sw $zero 0($t0) # last_char_time = 0
					sb $zero 4($t0) # current_line = 0
					sb $zero 5($t0) # current_char = 0
					li $t1 1
					sb $t1 6($t0) # lines = 1
					sb $zero 7($t0) # finished = 0
					li $t1 3
					sb $t1 8($t0) # x_pos = 3
					sb $t1 10($t0) # current_x_pos = 20
					li $t1 12
					sb $t1 9($t0) # y_pos = 12
					la $t1 PREPARE_TO
					sw $t1 12($t0) # line 1
					j after_pick_up_laser
				no_laser_collision:
				jr $ra
			after_pick_up_laser:
			
			lw $t0 ENTITIES+20 # t0 = dead_tick
			sub $t0 $s6 $t0 # t0 = tick - finished_tick
			blt $t0 120 after_switch_level_2_phase_4 # && dtick >= 120
				# Clear entities
				lb $zero ENTITY_COUNT
				# Store $ra in stack
				addi $sp $sp -4
				sw $ra 0($sp)
				jal clear_level_text
				# Restore $ra from stack
				lw $ra 0($sp)
				addi $sp $sp 4
				
				# Switch to phase 4
				li $t0 3
				sb $t0 GAME_DATA+1 # game_phase = 3
				j level_2_phase_4
			after_switch_level_2_phase_4:
			jr $ra
		level_2_phase_4:
		bne $t0 3 level_2_phase_5 # if game_phase == 3:
			li $t0 2
			sw $t0 ENTITY_COUNT
			
			# Spawn green alien
			li $t0 114
			sb $t0 ENTITIES+0 # x = 114
			li $t0 -7
			sb $t0 ENTITIES+1 # y = -7
			li $t0 3
			sb $zero ENTITIES+2 # animation_state = 3
			li $t0 PLAYER_WIDTH
			sb $t0 ENTITIES+3 # width
			li $t0 PLAYER_HEIGHT
			sb $t0 ENTITIES+4 # height
			li $t0 1
			sb $t0 ENTITIES+5 # entity_type = 1 = green alien
			sb $zero ENTITIES+6 # not dead
			la $t0 GREEN_ALIEN_SPRITE
			sw $t0 ENTITIES+8 # sprite_location
			li $t0 GREEN_ALIEN_SPRITE_WIDTH_4
			sw $t0 ENTITIES+16 # sprite_width_4
			li $t0 ALIEN_ATTACK_SPEED
			sb $t0 ENTITIES+24 # animation_speed
			li $t0 5
			sb $t0 ENTITIES+25 # animation_frames = 5
			li $t0 3
			sb $t0 ENTITIES+7 # health = 3
			li $t0 27
			sb $t0 ENTITIES+26 # final_y = 27
			sb $zero ENTITIES+27 # draw_to_background = false
			li $t0 1
			sb $t0 ENTITIES+45 # draw_to_background_on_final_y = true
			
			li $t1 ENTITY_STRUCT_BYTES # offset = 64
			# Spawn green alien 2
			li $t0 56
			sb $t0 ENTITIES+0($t1) # x = 56
			li $t0 -7
			sb $t0 ENTITIES+1($t1) # y = -7
			sb $zero ENTITIES+2($t1) # animation_state = 0
			li $t0 PLAYER_WIDTH
			sb $t0 ENTITIES+3($t1) # width
			li $t0 PLAYER_HEIGHT
			sb $t0 ENTITIES+4($t1) # height
			li $t0 1
			sb $t0 ENTITIES+5($t1) # entity_type = 1 = green alien
			sb $zero ENTITIES+6($t1) # not dead
			la $t0 GREEN_ALIEN_SPRITE
			sw $t0 ENTITIES+8($t1) # sprite_location
			li $t0 GREEN_ALIEN_SPRITE_WIDTH_4
			sw $t0 ENTITIES+16($t1) # sprite_width_4
			li $t0 ALIEN_ATTACK_SPEED
			sb $t0 ENTITIES+24($t1) # animation_speed
			li $t0 5
			sb $t0 ENTITIES+25($t1) # animation_frames = 5
			li $t0 3
			sb $t0 ENTITIES+7($t1) # health = 3
			li $t0 17
			sb $t0 ENTITIES+26($t1) # final_y = 17
			sb $zero ENTITIES+27($t1) # draw_to_background = false
			li $t0 1
			sb $t0 ENTITIES+45($t1) # draw_to_background_on_final_y = true
			
			# Switch to phase 5
			li $t0 4
			sb $t0 GAME_DATA+1 # game_phase = 4
		level_2_phase_5:
		bne $t0 4 level_2_phase_6 # if game_phase == 4:
			lb $t0 ENTITIES+6 # first green alien dead
			lb $t1 ENTITIES+70 # second green alien dead (6 + 64)
			beqz $t0 after_switch_level_3
			beqz $t1 after_switch_level_3
				# Clear entities
				lb $zero ENTITY_COUNT
				
				# Setup text animation
				la $t0 TEXT_ANIMATION_DATA
				sw $zero 0($t0) # last_char_time = 0
				sb $zero 4($t0) # current_line = 0
				sb $zero 5($t0) # current_char = 0
				li $t1 2
				sb $t1 6($t0) # lines = 2
				sb $zero 7($t0) # finished = 0
				li $t1 3
				sb $t1 8($t0) # x_pos = 3
				sb $t1 10($t0) # current_x_pos = 20
				li $t1 12
				sb $t1 9($t0) # y_pos = 12
				la $t1 I_WONDER
				sw $t1 12($t0) # line 1
				la $t1 SPACESHIP
				sw $t1 16($t0) # line 2
				
				# Switch to phase 6
				li $t0 5
				sb $t0 GAME_DATA+1 # game_phase = 5
			after_switch_level_3:
		level_2_phase_6:
		bne $t0 5 level_2_phase_7 # if game_phase == 5:
			lb $t0 TEXT_ANIMATION_DATA+7 # t0 = finished
			beqz $t0 after_switch_level_2_phase_2 # if finished:
			lw $t1 TEXT_ANIMATION_DATA+24 # t1 = finished_tick
			sub $t2 $s6 $t1 # t2 = tick - finished_tick
			blt $t2 40 after_switch_level_2_phase_2 # && dtick >= 40
				# Set level 3
				li $a0 2
				jal set_level
				j draw_start
		level_2_phase_7:
		jr $ra
	tick_level_3:
	bne $t0 2 tick_level_4 # if level == 2:
		lb $t0 GAME_DATA+1 # t0 = game_phase
		bnez $t0 level_3_phase_2 # if game_phase == 0:
			# Half movement speed
			lw $t0 KEY_TIME
			div $t0 $t0 2
			sw $t0 KEY_TIME
		
			# Spawn portal item
			li $t0 2
			sw $t0 ENTITY_COUNT
			
			# Spawn portal item
			li $t0 61
			sb $t0 ENTITIES+0 # x = 63
			li $t0 -4
			sb $t0 ENTITIES+1 # y = -4
			sb $zero ENTITIES+2 # animation_state = 0
			li $t0 ITEM_SIZE
			sb $t0 ENTITIES+3 # width
			sb $t0 ENTITIES+4 # height
			sb $zero ENTITIES+5 # entity_type = 0 = item
			sb $zero ENTITIES+6 # dead = false
			la $t0 PORTAL_ITEM_SPRITE
			sw $t0 ENTITIES+8 # sprite_location
			li $t0 PORTAL_ITEM_SPRITE_WIDTH_4
			sw $t0 ENTITIES+16 # sprite_width_4
			li $t0 5
			sb $t0 ENTITIES+24 # animation_speed = 5
			li $t0 4
			sb $t0 ENTITIES+25 # animation_frames = 4
			li $t0 44
			sb $t0 ENTITIES+26 # final_y = 42
			sb $zero ENTITIES+27 # draw_to_background = false
			sb $zero ENTITIES+45 # draw_to_background_on_final_y = false
			
			li $t1 ENTITY_STRUCT_BYTES # offset = 64
			# Spawn green alien
			li $t0 106
			sb $t0 ENTITIES+0($t1) # x = 106
			li $t0 -7
			sb $t0 ENTITIES+1($t1) # y = -7
			sb $zero ENTITIES+2($t1) # animation_state = 0
			li $t0 PLAYER_WIDTH
			sb $t0 ENTITIES+3($t1) # width
			li $t0 PLAYER_HEIGHT
			sb $t0 ENTITIES+4($t1) # height
			li $t0 1
			sb $t0 ENTITIES+5($t1) # entity_type = 1 = green alien
			sb $zero ENTITIES+6($t1) # not dead
			la $t0 GREEN_ALIEN_SPRITE
			sw $t0 ENTITIES+8($t1) # sprite_location
			li $t0 GREEN_ALIEN_SPRITE_WIDTH_4
			sw $t0 ENTITIES+16($t1) # sprite_width_4
			li $t0 ALIEN_ATTACK_SPEED
			sb $t0 ENTITIES+24($t1) # animation_speed = 8
			li $t0 5
			sb $t0 ENTITIES+25($t1) # animation_frames = 5
			li $t0 3
			sb $t0 ENTITIES+7($t1) # health = 3
			li $t0 16
			sb $t0 ENTITIES+26($t1) # final_y = 16
			sb $zero ENTITIES+27($t1) # draw_to_background = false
			sb $zero ENTITIES+44($t1) # draw_to_background_done = false
			li $t0 1
			sb $t0 ENTITIES+45($t1) # draw_to_background_on_final_y = true
			
			li $t0 1
			sb $t0 GAME_DATA+1 # game_phase = 1
		level_3_phase_2:
		bne $t0 1 level_3_phase_3 # if game_phase == 1:
			lw $t0 USER_DATA+4 # t0 = y
			blt $t0 -3 reset_level_4 # if y < -3:
			bge $t0 131 reset_level_4 # or y >= 131:
				lb $t0 ENTITIES+6 # t0 = dead
				bnez $t0 after_pick_up_portal # if !dead:
					# Check item collision with player
					lw $a0 USER_DATA+0 # a0 = player_x
					lw $a1 USER_DATA+4 # a1 = player_y
					lb $t5 ENTITIES+0 # t5 = entity_left
					subi $t5 $t5 3 # left -= item_size//2
					lb $t8 ENTITIES+1 # t8 = entity_top
					subi $t8 $t8 3 # top -= item_size//2
					addi $t7 $t5 ITEM_SIZE # t9 = entity_right
					addi $t6 $t8 ITEM_SIZE # t9 = entity_bottom
					move $s0 $ra
					jal check_collision
					move $ra $s0
			
					beqz $v0 no_portal_collision # if collision:
						sb $v0 ENTITIES+6 # dead = true
						sw $s6 ENTITIES+20 # dead_tick = tick
					
						# Setup text animation
						la $t0 TEXT_ANIMATION_DATA
						sw $zero 0($t0) # last_char_time = 0
						sb $zero 4($t0) # current_line = 0
						sb $zero 5($t0) # current_char = 0
						li $t1 2
						sb $t1 6($t0) # lines = 2
						sb $zero 7($t0) # finished = 0
						li $t1 3
						sb $t1 8($t0) # x_pos = 3
						sb $t1 10($t0) # current_x_pos = 20
						li $t1 2
						sb $t1 9($t0) # y_pos = 2
						la $t1 WITH_THIS
						sw $t1 12($t0) # line 1
						la $t1 BE_ABLE
						sw $t1 16($t0) # line 2
						
						# Switch to phase 2
						li $t0 2
						sb $t0 GAME_DATA+1 # game_phase = 2
					no_portal_collision:
				after_pick_up_portal:
				jr $ra # else: return
			reset_level_4:
				# Reset position
				li $t0 6
				sw $t0 USER_DATA+0
				mtc1 $t0 $f0
				cvt.s.w $f0 $f0
				swc1 $f0 USER_DATA+20
			
				li $t0 36
				sw $t0 USER_DATA+4
				mtc1 $t0 $f0
				cvt.s.w $f0 $f0
				swc1 $f0 USER_DATA+24
			
				# Reset movement
				sb $zero USER_DATA+28 # a_state = false
				sb $zero USER_DATA+29 # d_state = false
				sb $zero USER_DATA+30 # space_state = false
			
				move $s0 $ra
				jal damage_player
				move $ra $s0
				jr $ra
		level_3_phase_3:
		bne $t0 2 level_3_phase_4 # if game_phase == 2:
			lb $t0 TEXT_ANIMATION_DATA+7 # t0 = finished
			beqz $t0 after_switch_level_3_phase_4 # if finished:
			lw $t1 TEXT_ANIMATION_DATA+24 # t1 = finished_tick
			sub $t2 $s6 $t1 # t2 = tick - finished_tick
			blt $t2 60 after_switch_level_3_phase_4 # && dtick >= 60
				# Clear entities
				lb $zero ENTITY_COUNT
				
				# Store $ra in stack
				addi $sp $sp -4
				sw $ra 0($sp)
				
				# Set background to winning one
				jal clear_level_background_win
				
				# Restore $ra from stack
				lw $ra 0($sp)
				addi $sp $sp 4
			
				# Switch to phase 3
				li $t0 3
				sb $t0 GAME_DATA+1 # game_phase = 3
			after_switch_level_3_phase_4:
			jr $ra
		level_3_phase_4:
			
	tick_level_4:
	jr $ra

# a0 = entity_address
clear_entity_background:
	lb $t0 ENTITIES+0($a0) # x
	lb $t1 ENTITIES+1($a0) # y
	lb $t2 ENTITIES+3($a0) # width
	lb $t3 ENTITIES+4($a0) # height
	srl $t4 $t2 1
	sub $t0 $t0 $t4 # x -= width // 2
	srl $t4 $t3 1
	sub $t1 $t1 $t4 # y -= height // 2	
	
	sll $t4 $t1 7 # t2 = y-pos * 128
	add $t4 $t0 $t4 # t2 = x-pos + y-pos * 128
	sll $t4 $t4 2 # t2 = pixel_address = (y-pos * 128 + x-pos) * 4
	
	li $t0 0 # x = 0
	li $t1 0 # y = 0
	lw $t6 GAME_DATA+4 # t6 = level_background_address
	add $t6 $t6 $t4
	clear_entity_loop:
	blt $t0 $t2 after_reset_x # if x >= width:
		li $t0 0
		li $t5 LEVEL_WIDTH
		sll $t5 $t5 2
		add $t4 $t4 $t5 # pixel_address += LEVEL_WIDTH * 4
		add $t6 $t6 $t5
		sll $t5 $t2 2
		sub $t4 $t4 $t5 # pixel_address -= width * 4
		sub $t6 $t6 $t5
		addi $t1 $t1 1 # y += 1
	after_reset_x:
	bge $t1 $t3 after_clear_entity # if y < height:
		lw $t5 32768($t6)
		sw $t5 ($t6)
		sw $t5 BITMAP_BASE($t4)
		
		addi $t0 $t0 1 # x += 1
		addi $t4 $t4 4 # pixel_address += 4
		addi $t6 $t6 4
		j clear_entity_loop
	after_clear_entity:
	jr $ra
	
clear_level_background:
	# Store $ra in stack
	addi $sp $sp -4
	sw $ra 0($sp)

	lw $t2 GAME_DATA+4 # t2 = level_background_address
	li $t0 0 # t0 = i = 0
	clear_level_loop_2:
	bge $t0 BUFFER_SIZE after_clear_level_loop_2 # if i < BUFFER_SIZE
	#bge $t0 16384 after_clear_level_loop_2 # if i < (BUFFER_SIZE/2)
		lw $t1 32768($t2) # Copy of level
		sw $t1 ($t2)
		sw $t1 BITMAP_BASE($t0)
		sw $t1 RENDER_BUFFER($t0)

		addi $t0 $t0 4
		addi $t2 $t2 4
		j clear_level_loop_2
	after_clear_level_loop_2:

	li $s4 -4 # render_list_last = -4
	
	li $a0 1 # forced = true
	jal draw_gui
	
	# Restore $ra from stack
	lw $ra 0($sp)
	addi $sp $sp 4
	jr $ra
	
clear_level_background_win:
	# Store $ra in stack
	addi $sp $sp -4
	sw $ra 0($sp)

	lw $t2 GAME_DATA+4 # t2 = level_background_address
	li $t0 0 # t0 = i = 0
	clear_level_loop_3:
	bge $t0 BUFFER_SIZE after_clear_level_loop_3 # if i < BUFFER_SIZE
		lw $t1 65536($t2) # Copy of level
		sw $t1 ($t2)
		sw $t1 BITMAP_BASE($t0)
		sw $t1 RENDER_BUFFER($t0)

		addi $t0 $t0 4
		addi $t2 $t2 4
		j clear_level_loop_3
	after_clear_level_loop_3:

	li $s4 -4 # render_list_last = -4
	
	li $a0 1 # forced = true
	jal draw_gui
	
	# Restore $ra from stack
	lw $ra 0($sp)
	addi $sp $sp 4
	jr $ra

clear_level_text:
	# Store $ra in stack
	addi $sp $sp -4
	sw $ra 0($sp)

	lw $t2 GAME_DATA+4 # t2 = level_background_address
	li $t0 0 # t0 = i = 0
	clear_level_loop:
	#bge $t0 BUFFER_SIZE after_clear_level_loop # if i < BUFFER_SIZE
	bge $t0 16384 after_clear_level_loop # if i < (BUFFER_SIZE/2)
		lw $t1 ($t2) # Copy of level
		bne $t1 0x00FFFFFF after_clear_pixel # if pixel == text
			lw $t1 32768($t2) # Copy of level
			sw $t1 ($t2)
			sw $t1 BITMAP_BASE($t0)
			sw $t1 RENDER_BUFFER($t0)
		after_clear_pixel:
		addi $t0 $t0 4
		addi $t2 $t2 4
		j clear_level_loop
	after_clear_level_loop:

	#li $s4 -4 # render_list_last = -4
	
	li $a0 1 # forced = true
	jal draw_gui
	#jal draw_player
	#jal render_level_extras
	#li $a0 1 # forced = true
	#jal render_entities
	#jal render_buffer
	
	# Restore $ra from stack
	lw $ra 0($sp)
	addi $sp $sp 4
	jr $ra

# a0 = forced_draw
draw_gui:
	lb $t0 USER_DATA+43 # t0 = draw_health
	or $t0 $t0 $a0
	beqz $t0 after_draw_gui # if draw_health or forced_draw:
		sb $zero USER_DATA+43 # draw_health = false
		lb $t0 GAME_DATA+0 # t0 = level
		lb $t1 GAME_DATA+1 # t0 = game_phase
		
		bne $t0 1 after_level_2_placement # if level == 1:
			# Don't draw health on level 2 phase 0
			bnez $t1 level_2_placement # if game_phase = 0:
				jr $ra
			
			level_2_placement:
			li $a0 2 # x
			li $a1 2 # y
			j after_placement
		after_level_2_placement: # else:
			li $a0 2 # x
			li $a1 55 # y
			
		after_placement:
		# Store $ra in stack
		addi $sp $sp -4
		sw $ra 0($sp)
		jal draw_health
		# Restore $ra from stack
		lw $ra 0($sp)
		addi $sp $sp 4
	after_draw_gui:
	jr $ra
	
tick_text_animation:
	# Play text animation
	lb $t1 TEXT_ANIMATION_DATA+7 # t1 = finished
	bnez $t1 after_text_animation # if !finished:
		lw $t0 TEXT_ANIMATION_DATA+0 # t0 = last_char_time
		sub $t1 $s5 $t0 # t1 = time - last_char_time
		ble $t1 100 after_text_animation # if time - last_char_time > 100ms:
			sw $s5 TEXT_ANIMATION_DATA+0 # last_char_time = time
		
			before_text_animation:
			lb $t0 TEXT_ANIMATION_DATA+4 # t0 = current_line
			lb $t1 TEXT_ANIMATION_DATA+5 # t1 = current_char
	
			sll $t2 $t0 2 # t2 = current_line * 4
			lw $t2 TEXT_ANIMATION_DATA+12($t2) # t2 = string_adress = string_addresses[current_line]
			add $t2 $t2 $t1 # t2 = string_address + current_char
			lb $t2 0($t2) # t2 = char = string_address[current_char]
			
			bnez $t2 after_next_char # if char == '\0':
				addi $t0 $t0 1
				sb $t0 TEXT_ANIMATION_DATA+4 # current_line += 1
				sb $zero TEXT_ANIMATION_DATA+5 # current_char = 0
				lb $t1 TEXT_ANIMATION_DATA+8 # t1 = start_x
				sb $t1 TEXT_ANIMATION_DATA+10 # x_position = start_x
				
				lb $t3 TEXT_ANIMATION_DATA+6 # t3 = num_lines
				blt $t0 $t3 after_next_line # if (current_line + 1) >= num_lines:
					sb $t0 TEXT_ANIMATION_DATA+7 # finished = true
					sw $s6 TEXT_ANIMATION_DATA+24 # finished_tick = tick
					j after_text_animation
					
				after_next_line:
					
				lb $t3 TEXT_ANIMATION_DATA+9 # t3 = y_position
				addi $t3 $t3 7 
				sb $t3 TEXT_ANIMATION_DATA+9 # y_position += 6
					
				j before_text_animation
				
			after_next_char:
				
			# Store $ra in stack
			addi $sp $sp -4
			sw $ra 0($sp)

			move $a0 $t2 # a0 = char
			lb $a1 TEXT_ANIMATION_DATA+10 # a1 = x = x_position
			lb $a2 TEXT_ANIMATION_DATA+9 # a2 = y = y_position
				
			lb $t0 TEXT_ANIMATION_DATA+5
			addi $t0 $t0 1
			sb $t0 TEXT_ANIMATION_DATA+5 # current_char += 1
				
			bne $a0 32 add_6_x # if char == ' ':
				lb $t0 TEXT_ANIMATION_DATA+10
				addi $t0 $t0 3
				sb $t0 TEXT_ANIMATION_DATA+10 # x_position += 2
				j after_add_x
			#add_6_x:
			#bne $a0 32 add_6_x # if char == ' ':
			#	lb $t0 TEXT_ANIMATION_DATA+10
			#	addi $t0 $t0 3
			#	sb $t0 TEXT_ANIMATION_DATA+10 # x_position += 2
			#	j after_add_x
			add_6_x:
				lb $t0 TEXT_ANIMATION_DATA+10
				addi $t0 $t0 6 
				sb $t0 TEXT_ANIMATION_DATA+10 # x_position += 6
			after_add_x:
				
			jal draw_char
				
			# Restore $ra from stack
			lw $ra 0($sp)
			addi $sp $sp 4
				
			# Midi text writing sound
			li $a0 60
			li $a1 100
			li $a2 80
			li $a3 32
			li $v0 31
			syscall
	after_text_animation:
	jr $ra
	
# a0 = level
set_level:
	sb $a0 GAME_DATA+0 # level = a0 = level
	sb $zero GAME_DATA+1 # game_phase = 0
	lb $zero ENTITY_COUNT
	
	# --- SETUP LEVEL 1 ---
	bgtz $a0 after_set_level_1
		# Set background
		la $t0 LEVEL_BASE
		sw $t0 GAME_DATA+4
		la $t0 LEVEL_BASE_COLLISION
		sw $t0 GAME_DATA+8
		
		# Set player's initial position
		li $t0 5
		sw $t0 0($s7)
		mtc1 $t0 $f0
		cvt.s.w $f0 $f0
		swc1 $f0 20($s7)

		li $t0 38
		sw $t0 4($s7)
		mtc1 $t0 $f0
		cvt.s.w $f0 $f0
		swc1 $f0 24($s7)

		# Setup text animation
		la $t0 TEXT_ANIMATION_DATA
		sw $zero 0($t0) # last_char_time = 0
		sb $zero 4($t0) # current_line = 0
		sb $zero 5($t0) # current_char = 0
		li $t1 2
		sb $t1 6($t0) # lines = 2
		sb $zero 7($t0) # finished = 0
		li $t1 3
		sb $t1 8($t0) # x_pos = 3
		sb $t1 10($t0) # current_x_pos = 20
		li $t1 5
		sb $t1 9($t0) # y_pos = 5
		la $t1 YEAR_IS
		sw $t1 12($t0) # line 1
		la $t1 ALIENS_HAVE
		sw $t1 16($t0) # line 2
		j after_set_level
	after_set_level_1:
	# --- SETUP LEVEL 2 ---
	bgt $a0 1 after_set_level_2
		# Set background
		la $t0 LEVEL_OUTSIDE_BASE
		sw $t0 GAME_DATA+4
		la $t0 LEVEL_OUTSIDE_BASE_COLLISION
		sw $t0 GAME_DATA+8
		
		# Set player's initial position
		li $t0 6
		sw $t0 0($s7)
		mtc1 $t0 $f0
		cvt.s.w $f0 $f0
		swc1 $f0 20($s7)

		li $t0 50
		sw $t0 4($s7)
		mtc1 $t0 $f0
		cvt.s.w $f0 $f0
		swc1 $f0 24($s7)
		
		# Setup text animation
		la $t0 TEXT_ANIMATION_DATA
		sw $zero 0($t0) # last_char_time = 0
		sb $zero 4($t0) # current_line = 0
		sb $zero 5($t0) # current_char = 0
		li $t1 2
		sb $t1 6($t0) # lines = 2
		sb $zero 7($t0) # finished = 0
		li $t1 3
		sb $t1 8($t0)
		sb $t1 10($t0) # x_pos = current_x_pos = 3
		li $t1 5
		sb $t1 9($t0) # y_pos = 5
		la $t1 YOU_ARE
		sw $t1 12($t0) # line 1
		la $t1 TAKE_THIS
		sw $t1 16($t0) # line 2
		j after_set_level
	after_set_level_2:
	# --- SETUP LEVEL 3 ---
	bgt $a0 2 after_set_level_2
		# Set background
		la $t0 LEVEL_SPACE
		sw $t0 GAME_DATA+4
		la $t0 LEVEL_SPACE_COLLISION
		sw $t0 GAME_DATA+8
		
		# Set player's initial position
		li $t0 6
		sw $t0 USER_DATA+0
		mtc1 $t0 $f0
		cvt.s.w $f0 $f0
		swc1 $f0 USER_DATA+20
		li $t0 36
		sw $t0 USER_DATA+4
		mtc1 $t0 $f0
		cvt.s.w $f0 $f0
		swc1 $f0 USER_DATA+24
		
		# Setup text animation
		la $t0 TEXT_ANIMATION_DATA
		li $t1 1
		sb $t1 7($t0) # finished = true
		j after_set_level
	
	after_set_level:
	# Store $ra in stack
	addi $sp $sp -4
	sw $ra 0($sp)
	
	# Clear background level of entities and text
	jal clear_level_background
	
	# Draw new level
	li $s4 -4 # render_list_last = -4
	li $t0 0 # t0 = i = 0
	lw $t3 GAME_DATA+4 # t3 = level_base_address
	draw_loop:
	bge $t0 BUFFER_SIZE after_loop # if i < BUFFER_SIZE
		lw $t1 ($t3)
		sw $t1 BITMAP_BASE($t0)
		addi $t0 $t0 4
		addi $t3 $t3 4
		j draw_loop
	after_loop:
	
	li $a0 1 # forced_draw
	jal draw_gui
	
	# Restore $ra from stack
	lw $ra 0($sp)
	addi $sp $sp 4
	jr $ra

draw_player:
	# Draw player
	lw $t0 USER_DATA+0 # x-position
	addi $t0 $t0 -2
	lw $t1 USER_DATA+4 # y-position
	addi $t1 $t1 -2
	li $a0 PLAYER_WIDTH # player_width
	li $a2 0 # don't draw to background
	li $a1 PLAYER_HEIGHT # player_height
	la $t6 PLAYER_SPRITE
	li $a3 PLAYER_SPRITE_WIDTH_4
	lb $t8 32($s7)
	
	move $s0 $ra
	jal draw_sprite
	move $ra $s0
	
	# Draw laser
	lb $t0 USER_DATA+35 # laser_state
	beqz $t0 after_draw_laser
		lw $s0 USER_DATA+0 # t0 = x
		lw $s1 USER_DATA+4 # t1 = y
			
		lb $t2 USER_DATA+40 # t2 = facing
		beqz $t2 left_facing_offset
			li $t5 1
			addi $s0 $s0 1
			j after_facing_offset
		left_facing_offset:
			li $t5 -1
			addi $s0 $s0 5
		after_facing_offset:
		addi $s1 $s1 1
			
		move $t0 $s0
		move $t1 $s1
			
		sll $t2 $t1 7 # t2 = y * 128
		add $t2 $t2 $t0 # t2 = y * 128 + x
		sll $t2 $t2 2 # t2 = pixel_address = (y-pos * 128 + x-pos) * 4
			
		#li $t3 0 # i = 0
		draw_laser_loop:
		bltz $t0 after_draw_laser_loop
		bltz $t1 after_draw_laser_loop
		bge $t0 LEVEL_WIDTH after_draw_laser_loop
		bge $t1 LEVEL_HEIGHT after_draw_laser_loop
		#bgt $t3 20 after_draw_laser_loop # if i < 10
			# Draw upper pixel
			lw $t4 BITMAP_BASE($t2)
			andi $t4 $t4 0x80000000 # 1st bit: in list/not in list
			bnez $t4 after_add_player_list_2 # if pixel is not in list
				addi $s4 $s4 4
				sw $t2 RENDER_LIST($s4) # add pixel to render_list stack
			after_add_player_list_2:
			li $t4 0xFFDC473C # dark red
			sw $t4 RENDER_BUFFER($t2) # buffer[pixel_address] = dark red

			add $t0 $t0 $t5 # x += +-1
			mul $t4 $t5 4
			add $t2 $t2 $t4 # pixel_address += +-4
			#addi $t3 $t3 1 # i += 1
			j draw_laser_loop

		after_draw_laser_loop:
		# Move to next row
		addi $t1 $t1 1 # y += 1
		move $t0 $s0 # x = saved_x
		sll $t2 $t1 7 # t2 = y * 128
		add $t2 $t2 $t0 # t2 = y * 128 + x
		sll $t2 $t2 2 # t2 = pixel_address = (y-pos * 128 + x-pos) * 4
		#li $t3 0 # i = 0
		draw_laser_loop_2:
		bltz $t0 after_draw_laser
		bltz $t1 after_draw_laser
		bge $t0 LEVEL_WIDTH after_draw_laser
		bge $t1 LEVEL_HEIGHT after_draw_laser
		#bgt $t3 20 after_draw_laser # if i < 10
			# Draw upper pixel
			lw $t4 BITMAP_BASE($t2)
			andi $t4 $t4 0x80000000 # 1st bit: in list/not in list
			bnez $t4 after_add_player_list_3 # if pixel is not in list
				addi $s4 $s4 4
				sw $t2 RENDER_LIST($s4) # add pixel to render_list stack
			after_add_player_list_3:
			li $t4 0xFFE06057 # dark red
			sw $t4 RENDER_BUFFER($t2) # buffer[pixel_address] = dark red

			add $t0 $t0 $t5 # x += +-1
			mul $t4 $t5 4
			add $t2 $t2 $t4 # pixel_address += +-4
			#addi $t3 $t3 1 # i += 1
			j draw_laser_loop_2
	after_draw_laser:
	jr $ra

# a0 = x
# a1 = y
draw_health:
	move $s0 $ra
	move $s1 $a0
	move $s2 $a1

	# Heart 1
	li $a0 1
	jal get_health_offset # t8 = sprite_index
	move $t0 $s1 # x
	move $t1 $s2 # y
	li $a0 HEART_SIZE # entity_width
	li $a2 1 # draw to background
	li $a1 HEART_SIZE # entity_height
	la $t6 HEARTS_SPRITE # sprite_location
	li $a3 HEARTS_SPRITE_WIDTH_4 # entity_sprite_width_4
	jal draw_sprite
	
	# Heart 2
	li $a0 2
	jal get_health_offset # t8 = sprite_index
	addi $t0 $s1 8 # x
	move $t1 $s2 # y
	li $a0 HEART_SIZE # entity_width
	li $a2 1 # draw to background
	li $a1 HEART_SIZE # entity_height
	la $t6 HEARTS_SPRITE # sprite_location
	li $a3 HEARTS_SPRITE_WIDTH_4 # entity_sprite_width_4
	jal draw_sprite
	
	# Heart 3
	li $a0 3
	jal get_health_offset # t8 = sprite_index
	addi $t0 $s1 16 # x
	move $t1 $s2 # y
	li $a0 HEART_SIZE # entity_width
	li $a2 1 # draw to background
	li $a1 HEART_SIZE # entity_height
	la $t6 HEARTS_SPRITE # sprite_location
	li $a3 HEARTS_SPRITE_WIDTH_4 # entity_sprite_width_4
	jal draw_sprite

	jr $s0

# a0 = heart
# t8 = sprite_index
get_health_offset:
	lb $t0 GAME_DATA+2 # t0 = health_changed
	lb $t1 USER_DATA+33 # t1 = health
	lb $t2 USER_DATA+42 # t2 = last_health

	blt $t1 $a0 after_red # if health >= heart:
		beqz $t0 not_red_flashing # && health_changed:
			li $t8 1 # red flashing
			jr $ra
		not_red_flashing: # && !health_changed:
			li $t8 0 # red
			jr $ra
	after_red:
	blt $t2 $a0 black_heart # if last_health >= heart
	beqz $t0 black_heart # && health_changed:
		li $t8 2 # black flashing
		jr $ra
	black_heart:
	li $t8 3 # black
	jr $ra
	
# a0 = asciiz_address
# a1 = x
# a2 = y
draw_text:
	move $s0 $ra # save $ra
	move $s1 $a0 # s1 = i = asciiz_address
	move $s2 $a1 # s2 = x
	move $s3 $a2 # s3 = y
	
	draw_text_loop:
	lb $t1 ($s1) # t1 = char
	beqz $t1 after_draw_text # if char != '\0':
		bne $t1 32 draw_letter # if char == ' ':
			addi $s1 $s1 1
			addi $s2 $s2 3
			j draw_text_loop # return
			
		draw_letter:
		subi $t8 $t1 FONT_SPRITE_START # ascii(.) = 46
		move $t0 $s2 # entity_x = x
		move $t1 $s3 # entity_y = y
		la $t6 TEXT_SPRITE
		li $a0 5 # width = 5
		li $a1 5 # height = 5
		li $a2 0 # draw to background
		li $a3 FONT_SPRITE_WIDTH_4 # entity_sprite_width_4
		jal draw_sprite
		
		addi $s1 $s1 1
		addi $s2 $s2 6
		j draw_text_loop
	after_draw_text:
	jr $s0 # return to saved $ra
	
# a0 = char
# a1 = x
# a2 = y
draw_char:
	bne $a0 32 draw_letter_2 # if char == ' ':
		jr $ra
			
	draw_letter_2:
	move $s0 $ra # save $ra
	
	subi $t8 $a0 FONT_SPRITE_START # ascii(.) = 46
	move $t0 $a1 # entity_x = x
	move $t1 $a2 # entity_y = y
	la $t6 TEXT_SPRITE
	li $a0 FONT_SPRITE_SIZE # width = 5
	li $a1 FONT_SPRITE_SIZE # height = 5
	li $a2 1 # draw to background
	li $a3 FONT_SPRITE_WIDTH_4 # entity_sprite_width_4
	jal draw_sprite
	
	jr $s0 # return to saved $ra

# t0: entity_x
# t1: entity_y
# a0: entity_width
# a2: draw_to_background (0/1)
# a1: entity_height
# t6: sprite_location (address)
# a3: entity_sprite_width_4
# t8: sprite_index/animation_state
draw_sprite:
	move $t4 $t0 # t4 = player_x
	move $t7 $t1 # t7 = player_y
	
	sll $t1 $t1 7 # t2 = y-pos * 128
	add $t0 $t0 $t1 # t2 = x-pos + y-pos * 128
	sll $t0 $t0 2 # t2 = (y-pos * 128 + x-pos) * 4
	
	sll $t9 $a0 2 # t9 = player_width_4

	mul $t1 $a0 $t8 # sprite_x = player_width * animation_state
	li $t3 0 # t3 = sprite_y
	mul $t2 $t9 $t8 # t2 = player_width_4 * animation_state
	add $t6 $t6 $t2 # sprite_location += player_width_4 * animation_state
	
	draw_player_loop:
	mul $t2 $a0 $t8 # t2 = player_width * (animation_state + 1)
	add $t2 $t2 $a0
	blt $t1 $t2 after_increment_width # if sprite_x >= player_width * (animation_state + 1):
		sub $t1 $t1 $a0 # sprite_x -= PLAYER_WIDTH
		addi $t3 $t3 1 # sprite_y += 1
		sub $t4 $t4 $a0 # player_x -= PLAYER_WIDTH
		addi $t7 $t7 1 # player_y += 1
		add $t6 $t6 $a3 # sprite_location += sprite_width_4 - player_width_4
		sub $t6 $t6 $t9
		addi $t0 $t0 LEVEL_WIDTH_4 # display_location += level_width_4 - player_width_4
		sub $t0 $t0 $t9
	bge $t3 $a1 after_draw_player_loop # if y >= PLAYER_HEIGHT: return
	after_increment_width:
	
	bltz $t4 after_draw_player # x >= 0
	bltz $t7 after_draw_player # y >= 0
	bge $t4 LEVEL_WIDTH after_draw_player # && x < LEVEL_WIDTH
	bge $t7 LEVEL_HEIGHT after_draw_player # && y < LEVEL_HEIGHT
		lw $t5 0($t6) # t5 = pixel
		andi $t2 $t5 0xFF000000
		beqz $t2 after_draw_player # if pixel is transparent: continue
		
		bnez $a2 draw_to_background # if !draw_to_background:
			lw $v0 BITMAP_BASE($t0)
			andi $t2 $v0 0x80000000 # 1st bit: in list/not in list
			bnez $t2 after_add_player_list # if pixel is not in list
				addi $s4 $s4 4
				sw $t0 RENDER_LIST($s4) # add pixel to render_list stack
			after_add_player_list:
			sw $t5 RENDER_BUFFER($t0) # buffer[display_location] = pixel
			#ori $t2 $v0 0xFF000000 # TODO: Needed?
			ori $t2 $v0 0x80000000 # TODO: Needed?
			sw $t2 BITMAP_BASE($t0) # TODO: Needed?
			
			j after_draw_player
		draw_to_background:
			# TODO: Optimize this?
			lw $v0 GAME_DATA+4 # v0 = level_base_address
			add $v0 $v0 $t0 # v0 = level_base_address + display_location * 4
			
			andi $t5 $t5 0x00FFFFFF # set not_in_list
			sw $t5 ($v0) # level_base_address[display_location] = pixel
			sw $t5 BITMAP_BASE($t0) # bitmap[display_location] = pixel
	after_draw_player:
	
	addi $t1 $t1 1 # sprite_x += 1
	addi $t4 $t4 1 # player_x += 1
	addi $t6 $t6 4 # sprite_location += 4
	addi $t0 $t0 4 # display_location += 4
	j draw_player_loop
	
	after_draw_player_loop:
	jr $ra
	
handle_inputs:
	lw $t0 KEYBOARD_STATUS
	beqz $t0 after_handle_inputs
		lw $t0 KEYBOARD_KEY

		# Handle A
		li $t1 65
		beq $t0 $t1 input_a # if key == A
		li $t1 97
		beq $t0 $t1 input_a # or key == a
		j after_input_a
			input_a:
			sb $zero USER_DATA+40 # facing = 0 = left
			sb $t1 28($s7) # a_state = true
			sw $s6 8($s7)
			j after_handle_inputs
		after_input_a:
		
		# Handle D
		li $t1 68
		beq $t0 $t1 input_d # if key == D
		li $t1 100
		beq $t0 $t1 input_d  # or key == d
		j after_input_d
			input_d:
			li $t1 1
			sb $t1 USER_DATA+40 # facing = 1 = right
			sb $t1 29($s7) # d_state = true
			sw $s6 12($s7)
			j after_handle_inputs
		after_input_d:
	
		# Handle Space/W
		li $t1 32
		beq $t0 $t1 input_space # if key == space
		li $t1 87
		beq $t0 $t1 input_space # if key == W
		li $t1 119
		beq $t0 $t1 input_space # if key == w
		j after_input_space
			input_space:
			lb $t2 31($s7)
			beqz $t2 after_input_space # && is on ground
				sb $t1 30($s7)
				sw $s6 16($s7)
				j after_handle_inputs
		after_input_space:
		
		# Handle P (reset)
		li $t1 80
		beq $t0 $t1 input_p # if key == P
		li $t1 112
		beq $t0 $t1 input_p # or key == p
		j after_input_p
			input_p:
			j main
		after_input_p:
		
		# Handle E (Laser)
		lb $t1 USER_DATA+34 # t1 = laser_unlocked
		beqz $t1 after_handle_inputs # if laser_unlocked:
			li $t1 69
			beq $t0 $t1 input_e # if key == E
			li $t1 101
			beq $t0 $t1 input_e # or key == e
			j after_handle_inputs
				input_e:
				li $t1 1
				sb $t1 USER_DATA+35 # laser_state = true
				sw $s6 USER_DATA+36 # laser_time = tick
				j after_handle_inputs
		

	after_handle_inputs:
	jr $ra
	
handle_movement:
	# Reset Animation
	lb $t0 USER_DATA+41 # t0 = animation_offset
	sb $t0 USER_DATA+32 # animation_state = animation_offset

	# Handle Left
	lb $t0 28($s7) # a key state
	beqz $t0 handle_right
		lw $t0 8($s7) # a key time
		sub $t1 $s6 $t0
		lw $t2 KEY_TIME
		sub $t1 $t1 $t2
		bgez $t1 reset_left # if time - last_left < 100ms:
			# Move Left
			lwc1 $f0 20($s7)
			lwc1 $f1 24($s7)
			
			l.s $f2 left
			add.s $f0 $f0 $f2
			
			cvt.w.s $f2 $f0 # a0 = (int) x-position
			cvt.w.s $f3 $f1 # a1 = (int) y-position
			mfc1 $a0 $f2
			mfc1 $a1 $f3
			
			move $s0 $ra
			jal is_in_collision
			move $ra $s0
			bnez $v0 handle_right # if in_collision: continue
			
			swc1 $f0 20($s7) # update x-position float
			sw $a0 0($s7) # update x-position
			lb $t0 USER_DATA+41 # t0 = animation_offset
			addi $t0 $t0 2
			sb $t0 USER_DATA+32 # animation_state = animation_offset + 2 (left)
			
			j handle_right
		reset_left:
		sb $zero 28($s7) # reset a key state
	
	# Handle Right
	handle_right:
	lb $t0 29($s7) # d key state
	beqz $t0 handle_space
		lw $t0 12($s7) # d key time
		sub $t1 $s6 $t0
		lw $t2 KEY_TIME
		sub $t1 $t1 $t2
		bgez $t1 reset_right # if time - last_right < 100ms:
			# Move Right
			lwc1 $f0 20($s7)
			lwc1 $f1 24($s7)
			
			l.s $f2 right
			add.s $f0 $f0 $f2
			
			cvt.w.s $f2 $f0 # a0 = (int) x-position
			cvt.w.s $f3 $f1 # a1 = (int) y-position
			mfc1 $a0 $f2
			mfc1 $a1 $f3
			
			move $s0 $ra
			jal is_in_collision
			move $ra $s0
			bnez $v0 handle_space # if in_collision: continue
			
			swc1 $f0 20($s7) # update x-position float
			sw $a0 0($s7) # update x-position
			lb $t0 USER_DATA+41 # t0 = animation_offset
			addi $t0 $t0 1
			sb $t0 USER_DATA+32 # animation_state = animation_offset + 1 (left)
			
			j handle_space
		reset_right:
		sb $zero 29($s7) # reset d key state
	
	# Handle Space
	handle_space:
	lwc1 $f0 20($s7)
	lwc1 $f1 24($s7)
	l.s $f3 ZERO # f3 = downwards_offset
	
	move $s0 $ra
	jal is_in_reverse_gravity # v0 = in_reverse_gravity
	move $ra $s0
	move $s1 $v0
	
	lb $t0 30($s7) # space key state
	beqz $t0 after_handle_space
		lw $t0 16($s7) # space key time
		sub $t1 $s6 $t0
		lw $t2 KEY_TIME
		sub $t1 $t1 $t2
		
		bgez $t1 reset_space # if time - last_right < 100ms:
			# Move Upwards
			l.s $f2 upwards
			beqz $s1 after_reverse_space # if in_reverse_gravity
				neg.s $f2 $f2 # upwards *= -1
			after_reverse_space:
			add.s $f3 $f3 $f2 # downwards_offset += upwards
			j after_handle_space
		reset_space:
		sb $zero 30($s7) # reset space key state
	
	# Apply Gravity
	after_handle_space:
	
	l.s $f2 gravity
	beqz $s1 after_reverse_gravity # if in_reverse_gravity
		neg.s $f2 $f2 # gravity *= -1
	after_reverse_gravity:
	add.s $f3 $f3 $f2 # downwards_offset -= gravity
	
	add.s $f1 $f1 $f3
	
	cvt.w.s $f2 $f0 # a0 = (int) x-position
	cvt.w.s $f4 $f1 # a1 = (int) y-position
	mfc1 $a0 $f2
	mfc1 $a1 $f4
	
	move $s0 $ra
	jal is_in_collision
	move $ra $s0
	
	beqz $v0 disable_ground_state
	l.s $f2 ZERO
	beqz $s1 after_reverse_y_movement # if in_reverse_gravity
		neg.s $f3 $f3 # gravity *= -1
	after_reverse_y_movement:
	c.le.s $f3 $f2
	bc1t disable_ground_state # if y_movement > 0 && is_in_collision
		li $t0 1
		sb $t0 31($s7) # on_ground = true
		j after_disable_ground_state
	
	disable_ground_state:
	sb $zero 31($s7) # on_ground = false
	after_disable_ground_state:	
	
	bnez $v0 after_handle_movement # if !in_collision:
		swc1 $f1 24($s7) # update y-position float
		sw $a1 4($s7) # update y-position
	
	after_handle_movement:
	jr $ra
	
# v0 = in_reverse_gravity
is_in_reverse_gravity:
	lb $t0 GAME_DATA+0 # t0 = level
	bne $t0 2 after_in_reverse_gravity # if level == 2
		lw $t0 USER_DATA+0 # t0 = left
		#addi $t0 $t0 2
		lw $t1 USER_DATA+4 # t1 = top
		#addi $t1 $t1 2
		addi $t2 $t0 6 # t2 = right
		addi $t3 $t1 11 # t3 = bottom
		
		blt $t0 23 check_right # if left >= 23
		bgt $t0 44 check_right # && left <= 44
			li $v0 1
			jr $ra

		check_right:
		blt $t2 23 check_2_left # if right >= 23
		bgt $t2 44 check_2_left # && right <= 44
			li $v0 1
			jr $ra
		
		check_2_left:
		blt $t0 72 check_2_right # if left >= 72
		bgt $t0 99 check_2_right # && left <= 99
			li $v0 1
			jr $ra

		check_2_right:
		blt $t2 72 after_in_reverse_gravity # if right >= 72
		bgt $t2 99 after_in_reverse_gravity # && right <= 99
			li $v0 1
			jr $ra
	after_in_reverse_gravity:
	li $v0 0
	jr $ra
	

# a0: x-pos = left
# a1: y-pos = top
# return v0: is in collision box
is_in_collision:
	#addi $a0 $a0 2
	#addi $a1 $a1 2

	addi $t0 $a0 6 # t0 = right
	addi $t1 $a1 11 # t1 = bottom
	addi $v1 $a1 5 # v1 = middle-vertical
	
	# TODO Optimize by making screen bounds hardcoded, or using function?
	
	li $t3 0 # box = 0
	lw $t9 GAME_DATA+8 # t4 = collision_address
	lw $t4 ($t9) # t4 = collision_address[0] = num_boxes
	sll $t4 $t4 4 # num_boxes *= 16
	check_collision_loop:
	bge $t3 $t4 after_check_collision
		lw $t5 4($t9) # t5 = box_left
		lw $t6 8($t9) # t6 = box_bottom
		lw $t7 12($t9) # t7 = box_right
		lw $t8 16($t9) # t8 = box_top
		
		# Check top left corner
		blt $a0 $t5 bottom_left # left >= box_left
		bgt $a1 $t6 bottom_left # top <= box_bottom
		bgt $a0 $t7 bottom_left # left <= box_right
		blt $a1 $t8 bottom_left # top >= box_top
		li $v0 1
		jr $ra

		# Check bottom left corner
		bottom_left:
		blt $a0 $t5 bottom_right # left >= box_left
		bgt $t1 $t6 bottom_right # bottom <= box_bottom
		bgt $a0 $t7 bottom_right # left <= box_right
		blt $t1 $t8 bottom_right # bottom >= box_top
		li $v0 1
		jr $ra
		
		# Check bottom right corner
		bottom_right:
		blt $t0 $t5 middle_right # right >= box_left
		bgt $t1 $t6 middle_right # bottom <= box_bottom
		bgt $t0 $t7 middle_right # right <= box_right
		blt $t1 $t8 middle_right # bottom >= box_top
		li $v0 1
		jr $ra
		
		# Check bottom right corner
		middle_right:
		blt $t0 $t5 top_right # right >= box_left
		bgt $v1 $t6 top_right # middle_vertical <= box_bottom
		bgt $t0 $t7 top_right # right <= box_right
		blt $v1 $t8 top_right # middle_vertical >= box_top
		li $v0 1
		jr $ra
		
		# Check top right corner
		top_right:
		blt $t0 $t5 no_collision # right >= box_left
		bgt $a1 $t6 no_collision # top <= box_bottom
		bgt $t0 $t7 no_collision # right <= box_right
		blt $a1 $t8 no_collision # top >= box_top
		li $v0 1
		jr $ra
		
		no_collision:
		addi $t3 $t3 16
		addi $t9 $t9 16
		j check_collision_loop
	
	after_check_collision:
	li $v0 0
	jr $ra



# a0: player_x
# a1: player_y

# t5 = box_left
# t6 = box_bottom
# t7 = box_right
# t8 = box_top
# return v0: is in collision box
check_collision:
	#addi $a0 $a0 2
	#addi $a1 $a1 2

	addi $t0 $a0 6 # t0 = right
	addi $t1 $a1 11 # t1 = bottom
	addi $v1 $a1 5 # v1 = middle-vertical
	
	# Check top left corner
	blt $a0 $t5 bottom_left_2 # left >= box_left
	bgt $a1 $t6 bottom_left_2 # top <= box_bottom
	bgt $a0 $t7 bottom_left_2 # left <= box_right
	blt $a1 $t8 bottom_left_2 # top >= box_top
	li $v0 1
	jr $ra

	# Check bottom left corner
	bottom_left_2:
	blt $a0 $t5 bottom_right_2 # left >= box_left
	bgt $t1 $t6 bottom_right_2 # bottom <= box_bottom
	bgt $a0 $t7 bottom_right_2 # left <= box_right
	blt $t1 $t8 bottom_right_2 # bottom >= box_top
	li $v0 1
	jr $ra
		
	# Check bottom right corner
	bottom_right_2:
	blt $t0 $t5 middle_right_2 # right >= box_left
	bgt $t1 $t6 middle_right_2 # bottom <= box_bottom
	bgt $t0 $t7 middle_right_2 # right <= box_right
	blt $t1 $t8 middle_right_2 # bottom >= box_top
	li $v0 1
	jr $ra
		
	# Check bottom right corner
	middle_right_2:
	blt $t0 $t5 top_right_2 # right >= box_left
	bgt $v1 $t6 top_right_2 # middle_vertical <= box_bottom
	bgt $t0 $t7 top_right_2 # right <= box_right
	blt $v1 $t8 top_right_2 # middle_vertical >= box_top
	li $v0 1
	jr $ra

	# Check top right corner
	top_right_2:
	blt $t0 $t5 no_collision_2 # right >= box_left
	bgt $a1 $t6 no_collision_2 # top <= box_bottom
	bgt $t0 $t7 no_collision_2 # right <= box_right
	blt $a1 $t8 no_collision_2 # top >= box_top
	li $v0 1
	jr $ra
		
	no_collision_2:
	li $v0 0
	jr $ra
	
render_buffer:
	li $t0 0
	lw $t5 GAME_DATA+4 # t5 = level_background_address
	render_buffer_loop:
	bgt $t0 $s4 after_render_buffer_loop # while i <= render_list_last:
		lw $t2 RENDER_LIST($t0)
		lw $t3 RENDER_BUFFER($t2)
		
		andi $t4 $t3 0x40000000 # 2nd bit: draw/reset
		bnez $t4 render_buffer_draw # if reset pixel:
			# Reset pixel from level
			add $t4 $t5 $t2 # t4 = level_background_address + render_list[i]
			lw $t4 0($t4) # t4 = level_background_address[render_list[i]]
			#lw $t4 LEVEL_BASE($t2)
			#andi $t4 $t4 0x00FFFFFF
			sw $t4 BITMAP_BASE($t2)
			
			# Remove pixel from list
			lw $t2 RENDER_LIST($s4)
			sw $t2 RENDER_LIST($t0) # render_list[i] = render_list.last
			subi $s4 $s4 4 # render_list.last -= 4
			j render_buffer_loop
			
		# else: (draw pixel)
		render_buffer_draw:
			# Draw from buffer to display
			andi $t3 $t3 0xBFFFFFFF # set 2nd bit to reset
			sw $t3 RENDER_BUFFER($t2)
			sw $t3 BITMAP_BASE($t2)
			addi $t0 $t0 4
			j render_buffer_loop
	after_render_buffer_loop:
	jr $ra
	
	
	
